import React from 'react';
import styled from '@emotion/styled'

const Core = styled.div `
  position: relative;
  top: 100vh;
  width: 95%;
  background: white;
  border-radius: 40px;
  margin: auto;
  overflow: visible;

  min-width: 380spx;
  max-width: 650px;

  height: 400px;
`;
const Section = styled.div `
  margin: 10px;
`;
const Header = styled.div `
  font-weight: 500;
  font-size: 3vw;
`;

function Body() {
  return (
    <Core>
      <Section>
        <Header>Who am I?</Header>
      </Section>
    </Core>
  );
}

export default Body;
